import React from 'react'
import { StyledNav, StyledNavLogo } from './Nav.styled';

export default function Nav() {
  return (
   <>
    <StyledNavLogo>
          <h2>about</h2>
      </StyledNavLogo>
   
    <StyledNav>
          <h1>JUST DEV</h1>
      </StyledNav>
      
  </>
  )
}
